import React from "react";
import "./Carousel.css";

import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Carousel = ({image, imageAlt}) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div className="carousel">
      {/* CAROUSEL START*/}

      <Slider {...settings}>
        <img className="carousel-image" src={image} alt={imageAlt}/>
      </Slider>

      {/* CAROUSEL END*/}
    </div>
  );
};

export default Carousel;
